import Expertise from "./components/Expertise";
import Main from "./components/Main";
import SecondSlide from "./components/SecondSlide";
import Technologies from "./components/Technologies";

import "./index.css";

function App() {
  return (
    <div className="App">
      <Main />
      <SecondSlide />
      <Expertise />
      <Technologies />
    </div>
  );
}

export default App;
